import React from "react"

function NewOrUpdate(props){

    if(props.new === "true"){
        return(
            <div>
                Submit: <input  type={"submit"} id={"submit"} value={"Submit"}  onClick={()=> props.func(props.service,props.rental)}/>
            </div>
        )
    }else {
        return(
            <div>
                Update: <input  type={"submit"} id={"update"} value={"Update"}  onClick={()=> props.func(props.service,props.rental)}/>
            </div>
        )
    }
}

class RentalBookingForm extends React.Component{
    constructor(props){
        super(props);
        // this.state ={submit:true};
        console.log(props)
        this.sendData=this.sendData.bind(this);
    }
    sendData(service){
        let obj

        const bookingId = document.getElementById("bookingId").value
        const hotelID = document.getElementById("hotelID").value
        const roomNumber = document.getElementById("roomNumber").value
        const startDate = document.getElementById("startDate").value
        const endDate = document.getElementById("endDate").value
        const customerSIN = document.getElementById("customerSIN").value
         obj = "{" +
             "\"bookingId\":\""+bookingId+"\","
            if(this.props.rental){
                const rentalId = document.getElementById("rentalId").value
                obj = obj + "rentalId\":\""+rentalId+"\","
            }
            obj = obj + "\"hotelID\":\""+hotelID+"\","+
            "\"roomNumber\":\""+roomNumber+"\","+
            "\"startDate\":\""+startDate+"\","+
            "\"endDate\":\""+endDate+"\","+
            "\"customerSIN\":\""+customerSIN+"\"}"
        console.log(obj)
        console.log(rental)
        console.log(service)
        const xhr = new XMLHttpRequest()
        xhr.open('POST', '/server', true)
        xhr.send(obj)
    }
    render(){
        let button;
        let div;
        let div1;
        //change this from a state based condition to a props based condition
        if(this.props.submit){
            button = <NewOrUpdate new={"true"} func={this.sendData} service={"/notYetImplemented"}/>
        }else {
            button = <NewOrUpdate  func={this.sendData} service={"/notYetImplemented"}/>
        }
        if(this.props.rental){
            div = <div>
                    Rental Id: <input type={"text"} name={"rentalId"} id={"rentalId"}/>
                    <br/>
                </div>
            div1 = <div>
                    Booking Id: <input type={"text"} name={"bookingId"} id={"bookingId"}/>
                    <br/>
                    </div>
        }else {
            div = <div>
                    Booking Id: <input type={"text"} name={"bookingId"} id={"bookingId"}/>
                    <br/>
                </div>
        }
        return (
            <div>
                {/*<form>*/}
                {div}
                <div>
                    Hotel Id: <input type={"text"} id={"hotelID"}/>
                    <br/>
                </div>
                <div>
                    Room Number: <input type={"text"} id={"roomNumber"}/>
                    <br/>
                </div>
                <div>
                    Start Date: <input type={"date"} id={"startDate"}/>
                    <br/>
                </div>
                <div>
                    End Date: <input type={"date"} id={"endDate"}/>
                    <br/>
                </div>
                <div>
                    Customer SIN: <input type={"text"} id={"customerSIN"}/>
                    <br/>
                </div>
                {div1}
                <div>
                    {button}

                    Cancel: <input  type={"submit"} id={"Cancel"} value={"Cancel"}  />
                    <br/>
                </div>
                {/*</form>*/}
            </div>
        )
    }
}

export default RentalBookingForm
